// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./ABDKMath64x64.sol";

library LiquidityMath {
    using ABDKMath64x64 for int128;

    /// @dev
    /// @param x represent amount of token0
    /// @param sqrtPriceA squre root of Pa
    /// @param sqrtPriceB squre root of Pb
    function getLiquidityForX(
        uint256 x,
        uint256 sqrtPriceA,
        uint256 sqrtPriceB
    ) internal pure returns (uint256) {
        int128 xFixed = ABDKMath64x64.fromUInt(x);
        int128 sqrtPriceAFixed = ABDKMath64x64.fromUInt(sqrtPriceA);
        int128 sqrtPriceBFixed = ABDKMath64x64.fromUInt(sqrtPriceB);
        int128 intermediate = sqrtPriceBFixed.sub(sqrtPriceAFixed);
        return
            xFixed
                .mul(sqrtPriceAFixed)
                .mul(sqrtPriceBFixed)
                .div(intermediate)
                .toUInt();
    }

    /// @dev
    /// @param y represent amount of token1
    /// @param sqrtPriceA squre root of Pa
    /// @param sqrtPriceB squre root of Pb
    function getLiquidityForY(
        uint256 y,
        uint256 sqrtPriceA,
        uint256 sqrtPriceB
    ) internal pure returns (uint256) {
        int128 yFixed = ABDKMath64x64.fromUInt(y);
        int128 sqrtPriceAFixed = ABDKMath64x64.fromUInt(sqrtPriceA);
        int128 sqrtPriceBFixed = ABDKMath64x64.fromUInt(sqrtPriceB);
        int128 intermediate = sqrtPriceBFixed.sub(sqrtPriceAFixed);
        return yFixed.div(intermediate).toUInt();
    }

    /// @dev
    /// @param x represent amount of token0
    /// @param y ...
    /// @param sqrtPrice ...
    /// @param sqrtPriceA squre root of Pa
    /// @param sqrtPriceB squre root of Pb
    function getLiquidity(
        uint256 x,
        uint256 y,
        uint256 sqrtPrice,
        uint256 sqrtPriceA,
        uint256 sqrtPriceB
    ) internal pure returns (uint256 liquidity) {
        if (sqrtPrice <= sqrtPriceA) {
            liquidity = getLiquidityForX(x, sqrtPriceA, sqrtPriceB);
        } else if (sqrtPrice < sqrtPriceB) {
            uint256 liquidity0 = getLiquidityForX(x, sqrtPriceA, sqrtPriceB);
            uint256 liquidity1 = getLiquidityForY(y, sqrtPriceA, sqrtPriceB);
            if (liquidity0 > liquidity1) {
                liquidity = liquidity1;
            } else {
                liquidity = liquidity0;
            }
        } else {
            liquidity = getLiquidityForY(y, sqrtPriceA, sqrtPriceB);
        }
    }

    /// @dev if the price is outside the range, use the range endpoints instead
    function calculateX(
        uint256 liquidity,
        uint256 sqrtPrice,
        uint256 sqrtPriceA,
        uint256 sqrtPriceB
    ) internal pure returns (uint256) {
        uint256 tempP = _getSqrtPrice(sqrtPrice, sqrtPriceA, sqrtPriceB);
        int128 tempPFixed = ABDKMath64x64.fromUInt(tempP);
        int128 sqrtPriceBFixed = ABDKMath64x64.fromUInt(sqrtPriceB);
        int128 liquidityFiexd = ABDKMath64x64.fromUInt(liquidity);
        int128 intermediate = sqrtPriceBFixed.sub(tempPFixed);
        return
            liquidityFiexd
                .mul(intermediate)
                .div(tempPFixed)
                .div(sqrtPriceBFixed)
                .toUInt();
    }

    /// @dev if the price is outside the range, use the range endpoints instead
    function calculateY(
        uint256 liquidity,
        uint256 sqrtPrice,
        uint256 sqrtPriceA,
        uint256 sqrtPriceB
    ) internal pure returns (uint256) {
        uint256 tempP = _getSqrtPrice(sqrtPrice, sqrtPriceA, sqrtPriceB);
        int128 tempPFixed = ABDKMath64x64.fromUInt(tempP);
        int128 sqrtPriceAFixed = ABDKMath64x64.fromUInt(sqrtPriceA);
        int128 liquidityFiexd = ABDKMath64x64.fromUInt(liquidity);
        int128 intermediate = tempPFixed.sub(sqrtPriceAFixed);
        return
            liquidityFiexd
                .mul(intermediate)
                .toUInt();
    }

    function _getSqrtPrice(
        uint256 sqrtPrice,
        uint256 sqrtPriceA,
        uint256 sqrtPriceB
    ) private pure returns (uint256 tempP) {
        if (sqrtPrice >= sqrtPriceB) {
            tempP = sqrtPriceB;
        } else {
            tempP = sqrtPrice;
        }

        if (tempP > sqrtPriceA) {
            tempP = tempP;
        } else {
            tempP = sqrtPriceA;
        }
    }
}

